import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

function Card(props) {
  console.log(props);
  return (
    <>
      <div className="cards">
        <div className="card">
          <img src={props.imgsrc} alt="thumbnail" className="card-img" />
          <div className="card_info">
            <span className="card-category">{props.title}</span>
            <h3 className="card-title"></h3>
            <a  target="_blank" src={props.link}>
              <button>Watch now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

ReactDOM.render(
  <>
    <Card
      imgsrc="https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"
      title="A Netflix Orignal Series"
      sn="Stranger Things"
      link="https://www.netflix.com/in/"
    />
    <Card />
  </>,
  document.getElementById("root")
);
